  return (
    <Container className="mt-5">
      <Card className="p-4 shadow-sm">
        <h2 className="text-center mb-4">Welcome Admin</h2>

        <p><strong>Actions you can take:</strong></p>
        <ul>
          <li>üìä View Learner Performance Reports</li>
          <li>üìù Add or Update Test Data in Google Sheet</li>
          <li>üîê Manage Admin Access</li>
        </ul>

        <div className="text-center mt-4">
          <Button variant="primary" onClick={() => navigate('/')}>
            üîô Back to Login
          </Button>
        </div>
      </Card>
    </Container>
  );
};

export default AdminDashboard;
